"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=[{username:"ankush",picture:"https://randomuser.me/api/portraits/men/77.jpg",blogTitle:"A treatise of Chemistry",blogContent:"What happened was success. What happened was not that power corrupts, but rather, as the biographer Robert Caro would say, what happened is that power revealed.\n\n        Cornelius Vanderbilt began his career in shipping in the early 1800s alongside a man named Thomas Gibbons who fought a monopoly (successfully) all the way to the United States Supreme Court, a case considered a landmark ruling in U.S. commerce. Decades and billions of dollars later, Vanderbilt would famously say, “What do I care about the law? Haint I got the power?”\n        \n        This is the nature of world-altering success. It’s easy to be good when the stakes (and the valuations) are low. We can count on it as an immutable law of history: in any space where fame and fortune and power are up for grabs, Machiavelli eventually makes his appearance. Even if you started as the little guy or you were certified as a B Corp or put ‘Don’t Be Evil’ in your public filing documents.\n        \n        In present day, I like to think of this before and after picture of Jeff Bezos as a good example of the arc of a successful businessman or woman, one that is timeless and perennial. At first, you have a skinny nerdy guy who just wanted to sell us books over the computer, and fended off lawsuits by mega-retailers like Barnes & Noble and Wal-Mart for the privilege. Now, twenty or so years later, he’s jacked like a Terminator — the physical manifestation of his trillion-dollar company which has eaten the world — and his influence is now distributed through one of the most prestigious newspapers in the country…which he owns.\n        \n        We could compare two photos of Andrew Carnegie and see the same thing.\n        \n        Perhaps what’s set Silicon Valley apart — the difference between Elon Musk and John D. Rockefeller, Elizabeth Holmes and Jay Gould — is that it believes, since the “disruption” is orchestrated from behind a computer, it’s not the same. That it was somehow cleaner than coal or oil or steel. This is naive. Disruption is painful. People get hurt. And someone has to do that hurting\n        It’s called creative destruction for a reason\n        Good comes from it, but it’s not without its costs — to society or to the people who make it their living.\n        The ability to willfully seek out this destruction on a massive scale is, in its own way, a skill. Not all of us have it. It’s probably better than most of us do not. But certain people do. There are people who tastelessly start a business designed to put bodegas out of business (as one recent start up attempted) and there are people like Steve Jobs who artfully and heartlessly delivered a mortal blow to Eastman Kodak, a 129 year old company, with one addition to his design for the iPhone. And we cheered him for it. Between these two types, there is a Travis Kalanick who saw taxicab drivers not as solid middle class citizens, like many of us mistakenly did, but as a cabal of overpaid, rent-seeking obstacles to be broken apart and put out of work. Indeed, many of the early Uber investors I would speak to about Travis would remark that his greatest strength was his intense will to power. It was this unquestioning drive that allowed him to blow past technological hurdles, monopoly power, local regulations, unions, and in some cases, mob-controlled taxi companies."},{username:"julian",picture:"https://randomuser.me/api/portraits/women/77.jpg",blogTitle:"Physics Gods",blogContent:"As I opened the CT scan last week to read the next case, I was baffled. The history simply read “gunshot wound.” I have been a radiologist in one of the busiest trauma centers in the nation for 13 years, and have diagnosed thousands of handgun injuries to the brain, lung, liver, spleen, bowel, and other vital organs. I thought that I knew all that I needed to know about gunshot wounds, but the specific pattern of injury on my computer screen was one that I had seen only once before.\n\n        In a typical handgun injury that I diagnose almost daily, a bullet leaves a laceration through an organ like the liver. To a radiologist, it appears as a linear, thin, grey bullet track through the organ. There may be bleeding and some bullet fragments.\n        \n        I was looking at a CT scan of one of the victims of the shooting at Marjory Stoneman Douglas High School, who had been brought to the trauma center during my call shift. The organ looked like an overripe melon smashed by a sledgehammer, with extensive bleeding. How could a gunshot wound have caused this much damage?\n        \n        The reaction in the emergency room was the same. One of the trauma surgeons opened a young victim in the operating room, and found only shreds of the organ that had been hit by a bullet from an AR-15, a semi-automatic rifle which delivers a devastatingly lethal, high-velocity bullet to the victim. There was nothing left to repair, and utterly, devastatingly, nothing that could be done to fix the problem. The injury was fatal."},{username:"charlotte",picture:"https://randomuser.me/api/portraits/women/7.jpg",blogTitle:"Love and War",blogContent:"Routine handgun injuries leave entry and exit wounds and linear tracks through the victim’s body that are roughly the size of the bullet. If the bullet does not directly hit something crucial like the heart or the aorta, and they do not bleed to death before being transported to our care at a trauma center, chances are, we can save the victim. The bullets fired by an AR-15 are different; they travel at higher velocity and are far more lethal. The damage they cause is a function of the energy they impart as they pass through the body. A typical AR-15 bullet leaves the barrel traveling almost three times faster than, and imparting more than three times the energy of, a typical 9mm bullet from a handgun. An AR-15 rifle outfitted with a magazine cartridge with 50 rounds allows many more lethal bullets to be delivered quickly without reloading.\n\n        I have seen a handful of AR-15 injuries in my career. I saw one from a man shot in the back by a SWAT team years ago. The injury along the path of the bullet from an AR-15 is vastly different from a low-velocity handgun injury. The bullet from an AR-15 passes through the body like a cigarette boat travelling at maximum speed through a tiny canal. The tissue next to the bullet is elastic — moving away from the bullet like waves of water displaced by the boat — and then returns and settles back. This process is called cavitation; it leaves the displaced tissue damaged or killed. The high-velocity bullet causes a swath of tissue damage that extends several inches from its path. It does not have to actually hit an artery to damage it and cause catastrophic bleeding. Exit wounds can be the size of an orange."},{username:"becky",picture:"https://randomuser.me/api/portraits/women/92.jpg",blogTitle:"Painting with brushes",blogContent:"How To Fix\n        Some of these issues are related to the default iOS font: San Francisco. When iOS renders the system font, it automatically includes tracking based on the point size. This automatically-applied tracking table is available on Apple’s website. There is a Sketch plugin called “SF Font Fixer” which reflects these values in Sketch. I highly recommend it if your design uses San Francisco.\n        \n        (Side Note: Always remember to make the text box wrap tightly around text in Sketch. This can be done by selecting the text and toggling between “Fixed” and “Auto” alignment, then resetting the width of the text box. If there is any extra spacing, this can easily lead to incorrect values being entered into the layout.)\n        \n        2. Shadows\n        Unlike typography which has universal layout rules, shadows are less well-defined.\n        \n        As we can see in the image above, shadows in iOS are larger by default. In the examples above, this makes the most difference on the top edges of the rectangles.\n        \n        Shadows are tricky because the parameters between Sketch and iOS are not the same. The biggest difference is that there is no concept of “spread” on a CALayer, although this can be overcome by increasing the size of the layer that contains the shadow.\n        \n        "},{username:"timeo",picture:"https://randomuser.me/api/portraits/men/35.jpg",blogTitle:"Real India",blogContent:"India is great"},{username:"oğuzhan",picture:"https://randomuser.me/api/portraits/men/90.jpg",blogTitle:"America And God",blogContent:"Guns rule"},{username:"micheal",picture:"https://randomuser.me/api/portraits/men/49.jpg",blogTitle:"The Master theorem",blogContent:"Everything is null"},{username:"caroline",picture:"https://randomuser.me/api/portraits/women/37.jpg",blogTitle:"Machine Learning toolkit",blogContent:"Tensorflow"}];
